// SPDX-License-Identifier: MIT
pragma solidity ^0.8.10;

pragma experimental ABIEncoderV2;

interface IENVs {

    struct IENV {
        string IP;
        uint Port;
        uint Flag_SSH_Port;
        string Flag_SSH_User_Name;
        string Flag_SSH_Password;
    }

    struct ENV {
        uint id;
        uint contestId;
        uint challengeId;
        uint teamId;
        IENV info;
        uint timeStamp;
    }

    function add(uint contestId, uint challengeId, uint teamId, IENV calldata env) external;

    function update(uint contestId, uint id, IENV calldata env) external;

    function removes(uint contestId, uint [] memory _ids) external;

    function getContestENVIds(uint contestId) external view returns(uint [] memory);

    function getChallengeTeamENVId(uint challengeId, uint teamId) external view returns (uint);

    function getENV(uint id) external view returns (ENV memory);

    function getCount() external view returns (uint);

    function get(uint index) external view returns (ENV memory);
}
